css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("vogue.com") {

/*text&background*/

html, body, tbody, thead, th, tr, td, blockquote, li, ul, h1, h2, h3, h4, h5, h6, p, form, footer, .footer-col-2 .footer_white, #article_inner, #daily_inner, .template_3_col

{
color: white !important;
background: black !important;
}

#article_main .article_body, .footer-col-2 .legal

{
color: white !important;
}

#navigation, .footer-inner, #footer

{
background: black !important;
}

/*links*/

a

{
color: #0040ff !important;
}

/*highlight*/

textarea, pre

{
background: #333333 !important;
}

}
